import React from "react";
import { Container, Row, Col } from "react-bootstrap";

import "./styles.css";

export default function Footer() {
  return (
    <Container fluid="md">
      <Row>
        <Col>
            <div className="small-card-content"></div>
        </Col>
        <Col>
            <div className="big-card-content"></div>
        </Col>
      </Row>
    </Container>
  );
}
